import styled from 'styled-components'

// Create a Title component that'll render an <h1> tag with some styles
const ListActiveStyle = styled.div`
  width: 100%;
  height: 100%;
  display: relative;
  background-color: transparent;
  z-index: 1;
`;


export default ListActiveStyle;
